import React, { useState } from "react";
import "./Navbar.css";
import { Navigate, useNavigate } from "react-router-dom";

const Navbar = (props) => {
    const [isOpen, setIsOpen] = useState(false);
    // const [menu1, menu2] = props;
    const navigate = useNavigate();
    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };
    const link1 = () => {
        navigate(props.link1)
    }
    const link2 = () => {
        navigate(props.link2)
    }
    return (
        <div className="bunner">
            {/* ライン */}
            <div className="horizontal-line">
                <div className="tagName">
                    SkyGallery
                </div>
            </div>
            <div className="displayUserName">
                {props.username}
            </div>
            {/* ハンバーガーメニュー */}
            <div className="hamburger-menu">
                <button className="menu-button" onClick={toggleMenu}>
                    ☰
                </button>
                {isOpen && (
                    <div className="menu">
                        <button className="menu1" onClick={link1}>{props.menu1}</button>
                        <button className="menu1" onClick={link2}>{props.menu2}</button>
                    </div>
                )}
            </div>
        </div>
    );
};

export default HamburgerMenu;
